alphabet = ('a','b','c','d','e','f','g','h','i','j','k','l','m','n','o','p','q','r','s','t','u','v','w','x','y','z')

def react(polymer):
    reacted = False
    i = 0
    polymer = list(polymer)
    while True:
        if (polymer[i] != polymer[i + 1]) and (polymer[i].upper() == polymer[i+1] or polymer[i] == polymer[i+1].upper()):
            # print(polymer[i] +' ' + polymer[i+1])
            polymer.pop(i)
            polymer.pop(i)

            reacted=True
        i += 1
        if i > len(polymer) - 2:
            if reacted:
                i = 0
                reacted = False
            else:
                ans = ''.join(polymer)
                return len(ans)

results = []

for each in alphabet:
    temp = input.replace(each, '')    # print(input)
    temp = temp.replace(each.upper(), '')
    ans = react(temp)
    print(ans)
    # ans = len(input)
    results.append(ans)

print(results)
print(min(results))

